import React from "react";
import { Grid } from "../elements";
import styled from "styled-components";

const Header = (props) => {
  return (
    <React.Fragment>
      <Grid is_flex>
        <Image
          style={{ margin: "10px 10px" }}
          src="https://d1unjqcospf8gs.cloudfront.net/assets/home/base/header/logo-basic-24b18257ac4ef693c02233bf21e9cb7ecbf43ebd8d5b40c24d99e14094a44c81.svg"
        ></Image>
        <InputWrap>
          <Grid is_flex>
            <Input placeholder="동네 이름, 물품명 등을 검색해보세요!"></Input>
            <img src="https://d1unjqcospf8gs.cloudfront.net/assets/home/base/header/search-icon-7008edd4f9aaa32188f55e65258f1c1905d7a9d1a3ca2a07ae809b5535380f14.svg"></img>
          </Grid>
        </InputWrap>
        <button>App Store</button>
        <button>Google Play</button>
      </Grid>
    </React.Fragment>
  );
};

Header.defaultProps = {};

export default Header;

const InputWrap = styled.div`
  border-radius: 5px;
  border: solid 1px #e9ecef;
  text-decoration: none;
  padding: 0 1.6rem;
  height: 40px;
  box-sizing: border-box;
  margin: 10px 20px;
`;

const Input = styled.input`
  border: hidden;
  margin: 0px;
  padding: 10px;
  width: 340px;
  font-size: 16px;
  font-weight: 500;
`;

const Image = styled.img`
  width: 120px;
  vertical-align: text-bottom;
  margin-bottom: 5px;
`;
